            			local bonDesNat = tonumber(sheet.bon_DES_NAT) or 0;
            			sheet.DES_NAT = basDesNat + bonDesNat + spdBonEdC;
            			if (0 > (sheet.DES_NAT or 0)) then
            				sheet.DES_NAT = 0;
            				end
            
            			local bonAtletismo = 0
