            			if (Traveler) then
            				if (Sobrevivencia > Atletismo) then
            					ValDes.Temp3 = Sobrevivencia;
            					end
            				end
            			if (ValDes.Temp3 >= 3) then
            				bonAtletismo = 1;
            				end
            			sheet.bas_DES_FORCA = 4 + bonAtletismo + math.floor(Combate/4);
            			local basFORCA = tonumber(sheet.bas_DES_FORCA) or 4;
